import '../styles/categories.css';
import { Component } from 'react';


class Categories extends Component {


    render() {
        const foodCategory = this.props.dummyData.filter(d => d.categoty=="Food")
        const salaryCategory = this.props.dummyData.filter(d => d.categoty=="Salary")
        const entertainmentCategory = this.props.dummyData.filter(d => d.categoty=="Entertainment")
        console.log(foodCategory)

        return (
            <div>
                {foodCategory}
            </div>
        )
    }


}

export default Categories;
